export default function Item({ name, count, packed, handleDelete }) {
  return (
    <div id='item-lists' className='d-flex align-items-center p-2 gap-2 border'>
      <input type='checkbox' checked={packed}></input>
      <div>
        {count} of
        {name}
      </div>
      <button className='btn btn-danger' onClick={handleDelete}>
        x
      </button>
    </div>
  );
}
